import React from "react";
import { Route, Routes } from "react-router-dom";
import { AbandonedPage, ErrorPage, GenericPage, InstaEducation, LandingPage, SuccessPage } from "../Pages";
import {
  ROUTE_SUCCESS_PAGE,
  ROUTE_LANDING_PAGE,

} from "./RouteMapping";
import InviteExpiredPage from "../Pages/InviteExpiredPage/InviteExpiredPage";

function Router() {
  return (
    <Routes>
      <Route path={ROUTE_LANDING_PAGE} element={<LandingPage />}></Route>
      <Route path={ROUTE_SUCCESS_PAGE} element={<SuccessPage />}></Route>
      <Route path="*" element={<LandingPage />}></Route>
    </Routes>
  );
}

export default Router;
